import React from "react";
import { Spring } from "react-spring";
import styles from "./style/taskStyle.module.css";

const ElementBar = ({ progress }) => {
  return (
    <Spring from={{ percent: 0 }} to={{ percent: progress }}>
      {({ percent }) => (
        <div className={styles.progressvertical}>
          <div style={{ height: `${percent}%` }} className={styles.progressbar}>
            <span className="sronly">{`${progress}%`}</span>
          </div>
        </div>
      )}
    </Spring>
  );
};

export default ElementBar;
